import React from "react";
import "./Home.css";
import { Link } from "react-router-dom";

export default function Home() {
  return (
    <div className="Home">
      <div className="lander">
        <p>Detect objects on your photos with computer vision</p>
        <Link to="/inference" className="btn btn-success btn-sm">
          Get started
        </Link>
      </div>
    </div>
  );
}
